import './App.css';

function App() {
  return (
    <div className="App">
      Hello World !
      {fetch('https://api.giphy.com/v1/gifs/translate?api_key=YOUR_KEY_HERE&s=cats', {mode: 'cors'})
    .then(function(response) {
      console.log(response.json());
    })}
    </div>
  );
}

export default App;
